const removeDuplicates = function(s, k) {
  let cur = s, last;
  const set = new Set(s.split(''));
  const hash = {};

  for (let c of set) {
    hash[c] = new Array(k).fill(c).join('');
  }

  while (cur !== last) {
    last = cur;

    const reg = Object.values(hash).join('|');
    cur = cur.replaceAll(new RegExp(reg, 'g'), '');

    console.log(cur.length, last.length);
  }

  return cur;
};

